    are voids for DCCRW (Dallas County Council of Republican Women) for $12, First
    Ladies Republican Womens Club for $25, South Athens Storage for $45, and Sunnyvale
    Republican Women for $20. These checks were not cashed and were not required to
    be reissued. On Line 21, there are voided political contributions to: Christopher
    Shays for Congress Committee for $1000, House Conservatives Fund for $5000, Mike
    Rogers for Congress for $1000, Schock for Congress for $1000.  These checks were
    lost and not reissued. The Committee has demonstrated the necessary steps to establish
    best efforts to obtain and disclose the full identification of all individuals
    who contribute in excess of $200 in an election cycle. These efforts include a
    clear request with the original solicitation, followed within 30 days by a Request
    for Missing Information Letter, which clearly asks for the missing information,
    without soliciting a contribution. In addition, the letter reads: Federal law
    requires us to make our best efforts to collect and report the name, mailing address,
    occupation and name of employer of individuals who contribute in excess of $200
    in an election cycle. We then enclose a self-addressed envelope and include a
    telephone number to reach the committee with any questions. A second Request for
    Missing Information letter is sent if we do not receive the information in a timely
    manner. In the event that we receive additional information from contributors
    whose information was not originally disclosed, we will amend the appropriate
    report to reflect the additional disclosures properly.\n"
